import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../../assets/images/logo.png';
import  './Header.css'; 


const Header = () => {
  return (
    <header className="home-header">
      <img src={logo} alt="Kasa logo" className="home-logo" />
      <nav className="home-nav">
        <Link to="/" className="home-nav-link1">Accueil</Link>
        <Link to="/about" className="home-nav-link2">Ã€ propos</Link>
      </nav>
    </header>
  );
};
document.addEventListener("DOMContentLoaded", function() {
  const links = document.querySelectorAll(".home-nav-link");

  links.forEach(link => {
    link.addEventListener("click", function() {
      // Izbrishi podvlachuvanje od site linkovi
      links.forEach(l => {
        l.style.textDecoration = "none";
      });
      // Postavi podvlachuvanje na kliknatiot link
      this.style.textDecoration = "underline";
    });
  });
});
export default Header;
